import React, { Component } from "react";
import { Nav } from "react-bootstrap/Navbar";
// import Nav from "react-bootstrap/Navbar";

class Navbar extends Component {
  render() {
    return (
      <BootNav bg="light" expand="lg" fixed="top">
        <BootNav.Brand href="/">StatsDash</BootNav.Brand>
        <BootNav.Toggle aria-controls="basic-navbar-nav" />
        <BootNav.Collapse id="basic-navbar-nav">
          <BootNav className="mr-auto">
            <BootNav.Link href="/">About</BootNav.Link>
            <BootNav.Link href="/login">Dashboard</BootNav.Link>
            <BootNav.Link href="/">Log Out</BootNav.Link>
          </BootNav>
        </BootNav.Collapse>
      </BootNav>
    );
  }
}
export default Navbar;
